def solution_teacher():
    a, b, r = map(int, input().split())
    n = int(input())
    
    for _ in range(n):
        x, y = map(int, input().split())
        if (x-a)**2 + (y-b)**2 >= r**2:
            print('silent')
        else:
            print('noisy')

